  `use_vinyl_map` int(11) NOT NULL DEFAULT '0',
  `resource` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '废弃',
  `price` int(11) NOT NULL,
  `price_type` int(11) NOT NULL,
  `tenancy` int(11) NOT NULL COMMENT '租期 单位小时',
  `is_hot` int(11) NOT NULL,
  `is_new` int(11) NOT NULL,
  `is_best_sell` tinyint(4) NOT NULL,
