INSERT INTO `hints` VALUES (1,'全新捷豹F-TYPE将捷豹跑车血统一脉相承，带来最激发本性的驾驶感觉！'),(2,'全新捷豹F-TYPE V8 S配备5.0升V8发动机，百公里加速4.2秒，极速可达300码！'),(3,'全铝单壳式车身，让全新捷豹F-TYPE实现最佳平衡！'),(4,'全新捷豹F-TYPE，捷豹家族50年来首款双门双座运动型跑车！'),(6,'立即去车库免费领取捷豹F-TYPE，获胜更轻松。'),(7,'声望等级每提升一个级别时，会获得汽油奖励，级别越高奖励越多。'),(8,'职业生涯有三种赛事，1V5、1V1及速度赛。完成度100%后赛道等级提升，赛事更难奖励更多。'),(9,'每日挑战赛：每日免费参与可获金币，连续参与获得更多。'),(10,'公路赛（1V5）：完成比赛即可获经验(MW)及金钱，前三可获得声望(RP)。'),(11,'速度赛（1V0）：保持你的平均速度，开得稳比开得快更重要。'),(12,'无间追踪（1V1）：无论排名前后都能获得金钱和声望奖励。'),(13,'速度赛(1V0)：完成比赛即可得到金钱奖励。'),(14,'每完成一场比赛可以获得声望和金钱。'),(15,'声望等级越高，每场比赛完成后获得的金钱和声望越多。'),(16,'完成赛事可以获得经验(MW)，用于解锁新赛事和高级赛车。'),(17,'完成职业生涯或锦标赛来赚取金钱金币，用于升级模组与购买超跑。'),(18,'报名费较低，但奖金还不错的锦标赛，建议每天都来参加。'),(19,'有的锦标赛在用完次数之后还可以继续报名'),(20,'直到锦标赛结束之前，排名都可能发生变化'),(21,'围追堵截全民汽油锦标赛：两小时一次，结束就可领汽油。低耗赚汽油方便快捷。'),(22,'每日赚金钱锦标赛：有机会获得最高十倍的金钱返还。'),(23,'金币赛车专享的锦标赛奖励高于金钱车专享锦标赛。'),(24,'每周限量赛车争夺赛：冠军可以获得每周限量车。'),(25,'每日赏金锦标赛：没有金币车就来这里赚金币。'),(26,'免费金币可以通过:锦标赛，新手任务，每日挑战赛和生涯模式地图等级提升来获得。'),(27,'撞翻警察可以获得氮气补给，注意如果不成功则有可能损坏车辆和减慢速度。'),(28,'在SUV车上使用模组可以有效撞击警车阻拦。'),(29,'在直道坡路上产生飞跃以及直道平路上使用氮气可以得到更好的效果。'),(30,'每天下午3点会自动恢复120点汽油，在那之前用完最划算。'),(31,'每次重新登录游戏会自动更新您的好友系统。'),(32,'赛车撞毁或者被警察抓住，是不会获得奖励的'),(33,'如果担心被撞毁，可以使用冲击保护模组'),(34,'经验(MW)达到才能参加考级赛，不够的话再跑几轮生涯。'),(35,'职业的赛手可以达到全程漂移！你试过么？'),(36,'漂移过弯不减速并且快速恢复氮气。'),(1037,'爱卡汽车锦标赛总冠军 将获得价值1000元的车载空气净化器。\n');
